import React, { useState } from 'react';
import { GoogleMap, useLoadScript, OverlayView } from '@react-google-maps/api';
import anh from "../assets/test.jpg"
const mapContainerStyle = {
  width: '100vw',
  height: '100vh',
};

const center = {
  lat: 21.1509, // Example latitude
  lng: 105.8369, // Example longitude
};

const overlayImageStyle = (opacity) => ({
  position: 'absolute',
  top: 0,
  left: 0,
  width: '100%',
  height: '100%',
  opacity: opacity,
});

const GoogleMapOverlay = () => {
  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: 'AIzaSyA3bsDl1xddiU_w38hA-fsGea8kWsp5uJM', // Thay thế bằng API key của bạn
  });

  const [opacity, setOpacity] = useState(0.5);

  if (loadError) return <div>Error loading maps</div>;
  if (!isLoaded) return <div>Loading Maps</div>;

  return (
    <div style={{ position: 'relative' }}>
      <GoogleMap mapContainerStyle={mapContainerStyle} center={center} zoom={10}>
        <OverlayView
          position={center}
          mapPaneName={OverlayView.OVERLAY_LAYER}
        >
          <div style={{ width: '100vw', height: '100vh', position: 'relative' }}>
            <img
              src={anh} // Thay thế bằng URL của ảnh bạn muốn phủ
              alt="Overlay"
              style={overlayImageStyle(opacity)}
            />
          </div>
        </OverlayView>
      </GoogleMap>
      <div style={{ position: 'absolute', bottom: 50, left: '50%', transform: 'translateX(-50%)', backgroundColor: 'white', padding: 10, borderRadius: 5 }}>
        <input
          type="range"
          min="0"
          max="1"
          step="0.01"
          value={opacity}
          onChange={(e) => setOpacity(e.target.value)}
        />
        <span>{`Opacity: ${opacity}`}</span>
      </div>
    </div>
  );
};

export default GoogleMapOverlay;
